import { createBrowserRouter } from "react-router-dom"
import HomePages from './../../pages/HomePages/HomePages';
import ListPages from './../../pages/ListPages/ListPages';

export const newRouter = createBrowserRouter([
    {
        path: '/',
        element: <App />,
        children: [
            {
                path: '/',
                element: <HomePages />
            },
            {
                path: '/list/:id',
                element: <ListPages />
            },
        ]
    }
])
